import React from 'react';

const FriendItem = ({item,onDel}) => {
    const {id, name,age,image} = item
    return (
        <li>
            <p>
                <img src={image} alt = {name}/>
            </p>
            <div>
                <strong>이름 : {name}</strong>
                <span>나이 :{age}</span>
                <button style={{marginTop:15}} onClick={()=>onDel(id)}> 삭제 </button>
            </div>
        </li>
    );
};

export default FriendItem;
